webpackJsonp([0xbd2c9008c5d4],{6934:function(e,t){e.exports={data:{post:{html:'<p>All the US blogs I\'ve read on the DNC <a href="http://www.dangerousmeta.com/?p=4013">have</a> <a href="http://www.buzzmachine.com/archives/2004_07_28.html#007607" title="BuzzMachine... by Jeff Jarvis">raved</a> <a href="http://www.davosnewbies.com/2004/07/28#onObama">about</a> the <a href="http://www.msnbc.com/modules/interactive.asp?id=/d/ip/dnc_tuesday_videos_152/data.js&navid=3032091&fmt=full&cp1=1">keynote </a> by <a href="http://www.newyorker.com/fact/content/?040531fa_fact1">Barack Obama</a>, but he hasn\'t been mentioned in any German media at all... except the <a href="http://blog.tagesschau.de/">new Tagesschau blog</a>. No feed, no permalinks, but they might have something right. (No, I haven\'t seen the speech yet. It\'s in Windows Media format, and  I haven\'t sat at a Windows machine yet today.)</p>',fields:{title:"Score One for the Tagesschau",date:"28 Jul 2004",url:"https://papascott.de/2004-07-28-score-one-for-the-tagesschau/"}}},pathContext:{slug:"/2004-07-28-score-one-for-the-tagesschau/",prev:{fields:{title:"Lack of diversity",date:"28 Jul 2004",slug:"/2004-07-28-lack-of-diversity/"}},next:{fields:{title:"Swag",date:"29 Jul 2004",slug:"/2004-07-29-swag/"}}}}}});
